// STYLE
import './header.scss';

function Header() {
    return (
        <header className='header'>
            <h1 className="header__title">Thierry <strong>DE SOUSA</strong></h1>
            <p className='header__text1'>Développeur web Front-End JavaScript/React.js</p>
            <p className='header__text2'>Passionné et engagé</p>
        </header>
    )
}

export default Header;
